    bool operator != (const Double& b) {
        if (v.size() > b.v.size()) {
            return  true;
        }
        else if (v.size() < b.v.size()) {
            return  true;
        }
        else {
            for (lint i = v.size() - 1; i >= 0; --i) {
                if (v[i] != b.v[i]) {
                    return  true;
                }
            }
        }
        return  false;
    }
