    Double reverse_number_newton() {
        lint kol = accuracy / loginf;
        Double c = *this;
        c >> (v.size()- kol-1);
        for (lint i = 0; i < accuracy - loginf * kol; ++i) {
            c /= 10;
        }
        Double a1("1"),x=c;
        for (lint i = 0; i < accuracy; ++i) {
            x += (a1 - c * x);
        }
        x >> (v.size() - kol - 1);
        for (lint i = 0; i < accuracy - loginf * kol; ++i) {
            x /= 10;
        }
        return x;
    }
